Gently used LIKE NEW in factory package with tags and literature;
The Galco Paddle Speed Firearm Holster is the perfect holster for law enforcement professionals who require a high quality and secure way to hold their firearms. This Firearm Holster by Galco is built with an open top design for quick draw and firearm access. The Galco Speed Paddle Pistol Holster is made with a copolymer injection-molded belt-lock paddle, which makes it possible to put on and take off this holster without removing your belt. This Galco Belt Holster has a covered trigger guard that offers improved safety. The tension screw adjustment system on the Galco Speed Paddle Holster allows you to make sure your holster stays put. These typically sell at retail of $60.00-$70.00 each.
